import React from 'react'
import { render } from 'react-dom'

class StorePicker extends React.Component {
  render() {
    return (
      <form>
        <h2>Please enter a Store name:</h2>
        <input type="text" />
        <button>Search</button>
      </form>
    )
  }
}

export default StorePicker;
